import React, { useState } from 'react';
import Fab from '@mui/material/Fab';
import AddIcon from '@mui/icons-material/Add';
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';
import IconButton from '@mui/material/IconButton';
import VisibilityIcon from '@mui/icons-material/Visibility';
import TextField from '@mui/material/TextField';
import data from '../data.json';
import '../styles/accounting.css';

function Accounting() {
    const [isModalOpen, setIsModalOpen] = useState(false);
    const [isEditModalOpen, setIsEditModalOpen] = useState(false);
    const [isDeleteModalOpen, setIsDeleteModalOpen] = useState(false);
    const [isDetailsOpen, setIsDetailsOpen] = useState(false);
    const [employees, setEmployees] = useState(data);
    const [selectedEmployee, setSelectedEmployee] = useState(null);
    const [searchQuery, setSearchQuery] = useState('');
    const [sortBy, setSortBy] = useState('name');

    // Проверяем, открыты ли какие-либо модальные окна
    const isAnyModalOpen = isModalOpen || isEditModalOpen || isDeleteModalOpen || isDetailsOpen;

    const handleOpenModal = () => {
        setIsModalOpen(true);
    };

    const handleCloseModal = () => {
        setIsModalOpen(false);
        setSelectedEmployee(null);
    };

    // Остальные функции управления модальными окнами

    const handleSearch = (event) => {
        setSearchQuery(event.target.value);
    };

    const handleSortChange = (event) => {
        setSortBy(event.target.value);
    };

    const filteredAndSortedEmployees = employees
        .filter((employee) =>
            employee.name.toLowerCase().includes(searchQuery.toLowerCase())
        )
        .sort((a, b) => {
            if (sortBy === 'name') {
                return a.name.localeCompare(b.name);
            } else if (sortBy === 'position') {
                return a.position.localeCompare(b.position);
            } else if (sortBy === 'access') {
                return a.access - b.access;
            }
        });

    return (
        <div>
            <div style={{ marginBottom: '10px' }}>
                <TextField
                    id="search"
                    label="Поиск"
                    variant="outlined"
                    value={searchQuery}
                    onChange={handleSearch}
                />
                <label>
                    Сортировать по:
                    <select value={sortBy} onChange={handleSortChange}>
                        <option value="name">Имени</option>
                        <option value="position">Должности</option>
                        <option value="access">Допуску</option>
                    </select>
                </label>
            </div>

            <table className="employee-table">
                <thead>
                    <tr>
                        <th>Имя</th>
                        <th>Должность</th>
                        <th>Допуск</th>
                        <th>Действие</th>
                    </tr>
                </thead>
                <tbody>
                    {filteredAndSortedEmployees.map((employee, index) => (
                        <tr key={index}>
                            <td>{employee.name}</td>
                            <td>{employee.position}</td>
                            <td>{employee.access}</td>
                            <td>
                                <IconButton aria-label="details" onClick={() => setIsDetailsOpen(true)} disabled={isAnyModalOpen}>
                                    <VisibilityIcon />
                                </IconButton>
                                <IconButton color="primary" aria-label="edit" onClick={() => setIsEditModalOpen(true)} disabled={isAnyModalOpen}>
                                    <EditIcon />
                                </IconButton>
                                <IconButton color="secondary" aria-label="delete" onClick={() => setIsDeleteModalOpen(true)} disabled={isAnyModalOpen}>
                                    <DeleteIcon />
                                </IconButton>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>

            <div className="containeradd text-center">
                {!isAnyModalOpen && (
                    <Fab color="primary" aria-label="add" onClick={handleOpenModal}>
                        <AddIcon />
                    </Fab>
                )}
            </div>
        </div>
    );
}

export default Accounting;
